@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

atm:Account a owl:Class .
atm:Money a owl:Class .
atm:ATM a owl:Class .

atm:dispenses a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Money .

atm:updates a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Account .

atm:after a owl:TransitiveProperty ;
  rdfs:domain owl:Thing ;
  rdfs:range owl:Thing .

atm:dispenses rdfs:subPropertyOf atm:after .
atm:updates rdfs:subPropertyOf atm:after .
